import React from 'react';
import AllUsers from '../AllUsers/AllUsers.js';

const UsersList = props => {
    return (
      <ul>
        {props.items.map(user => (
          <AllUsers
            key={user.id}
            id={user.id}
          >
            `${user.username}({user.age})`
          </AllUsers>
        ))}
      </ul>
    );
  };

  export default UsersList;
